INSERT INTO `platforms` VALUES (1,'Academics.de','academics.de bietet eine umfangreiche Plattform zum Thema Wissenschaft und Forschung in Deutschland, sterreich und der Schweiz. Die Stellenangebote kommen von forschenden Unternehmen, Forschungseinrichtungen und Hochschulen. Die Aufteilung der Jobbrse nach Forschungsgebieten und Karrierestationen ermglicht Unternehmen eine zielgerichtete Schaltung von Stellenanzeigen.','http://www.academics.de',8,4,0,1,1,'2010-09-20 08:24:01','2012-01-23 15:57:41','academics.png','image/png',3335,'2010-10-06 13:06:34',10,NULL,''),(2,'Gak.de - Gummi Fasern Kunststoffe - Fachmagazin fr die Polymerindustrie','GAK - Gummi Fasern, Kunststoffe ist ein Fachmagazin der Polymerindustrie und bietet auf seiner Website neben redaktionellem Content auch eine Jobbrse an. Der Stellenmarkt hat 150.000 Visits pro Monat und kooperiert mit der Stellenbrse plasticker.de. Durch die Mglichkeit, zielgerichtet qualifiziertes technisches oder kaufmnnisches Fachpersonal anzusprechen, haben Unternehmen hier die Mglichkeit, eine zielgruppenorientierte und punktgenaue Personalgewinnung zu betreiben.','http://www.gupta-verlag.com/kautschuk',5,2,0,1,1,'2010-09-21 10:19:39','2012-01-24 15:50:54','GAK.PNG','image/png',21491,'2010-09-21 10:19:39',8,306,''),(4,'Dprg.de','Praktikanten- und Traineebrse der Deutschen Public Relations Gesellschaft e. V. - Berufsverband fr alle PR-Fachleute in Deutschland. ','http://www.dprg.de',6,4,0,1,1,'2010-09-21 10:22:11','2012-01-24 13:23:30','dprg.jpg','image/jpeg',13766,'2012-01-24 13:23:30',7,NULL,''),(7,'Jarocco.de','jarocco.de ist ein Netzwerk fr Akademiker, das im angeschlossenen Stellenmarkt Jobs fr Akademiker aus allen Branchen anbietet. Daneben werden ebenso ausschlielich bezahlte Praktikastellen fr die Zielgruppe ausgeschrieben. Der Newsletter an 900 Abonnenten bringt zustzliche Aufmerksamkeit auf die eigene Stellenanzeige. Durch die hohe Reichweite knnen Unternehmen ein groes, hochqualifiziertes Bewerberfeld ber jarocco.de erreichen. ','http://www.jarocco.de',8,3,0,1,1,'2010-09-21 10:30:11','2012-01-25 08:51:38','Jarocco.de.jpg','image/jpeg',9848,'2012-01-25 08:51:38',7,NULL,''),(8,'Gastro.de ','Hier knnen Sie als Unternehmen Stellenangebote fr die Bereiche Gastronomie, Hotellerie & Tourismus  schalten.','http://www.gastro.de',8,4,0,1,1,'2010-09-21 10:40:13','2012-01-24 15:10:40','gastro.PNG','image/png',4383,'2010-09-21 10:40:13',6,NULL,''),(12,'DV-Treff.de','dv-treff.de ist auf Stellenangebote aus dem SAP-Bereich spezialisiert. Neben Deutschland bietet die Brse auch SAP Jobs aus Europa und bersee. Die Jobbrse hat eine groe Reichweite und hohe Bekanntheit in der Branche mit google-Top-10-Platzierung bei relevanten Suchbegriffen. Dazu enthlt die Bewerberdatenbank ber 350 Profile von SAP Beratern und Entwicklern. Dv-treff.de bietet auerdem Jobbrsen-Paketschaltungen fr Stellenanzeigen bei monster, jobscout24, jobware, stellenanzeigen.de und anderen.','http://www.dv-treff.de',6,3,0,1,1,'2010-09-21 10:46:34','2012-01-24 13:50:25','dv-treff.de.jpg','image/jpeg',4482,'2011-08-02 08:48:28',5,NULL,''),(13,'Deutscher Verein fr Vermessungswesen','Jobbrse fr Geodsie, Geoinformation und Landmanagement - Der DVW e.V. wurde 1871 gegrndet. Ziel war es damals, das \"gesamte Vermessungswesen, namentlich durch Verbreitung wissenschaftlicher Erkenntnisse und praktischer Erfahrungen zu heben und zu frdern\". Ergnzend dazu ist es der heutige Vereinszweck, die Ziele und Belange seiner Mitglieder in den Bereichen Geodsie, Geoinformation und Landmanagement zu vertreten, zu frdern und zu koordinieren sowie die fachlichen Entwicklungen aufzuzeigen und praktischen Erfahrungen zu vermitteln. Der DVW ist als Mitglied in der Internationalen Vereinigung der Vermessungsingenieure (FIG) vertreten. Er setzt sich aus 13 Landesvereinen mit derzeit insgesamt knapp 8.800 Mitgliedern zusammen.','http://www.dvw.de',3,2,0,1,1,'2010-09-21 10:53:11','2010-10-06 08:09:23','dvw_logo_blau_unten_72dpi.jpg','image/jpeg',26930,'2010-09-21 10:53:11',3,NULL,''),(14,'Gastronomiecareer.de','gastronomie-career.de ist eine Jobbrse mit Schwerpunkten in den Bereichen Gastronomie, Kche, Hotellerie oder Catering und weist dabei sehr hohe Inseratszahlen auf. Umfangreiche Kooperationspartner stellen zustzlich eine sehr hohe Reichweite sicher. Bewerber knnen auerdem ein Profil anlegen und sich ber den Newsletter ber aktuelle Stellenangebote informieren lassen. Unternehmen knnen hier qualifizierte Spezialisten auf sich aufmerksam machen und effizient ihre offenen Stellen aus den Branchen ausschreiben.','http://www.gastronomiecareer.de',6,4,0,1,1,'2010-09-21 10:53:29','2012-01-24 15:15:28','gastronomie-career.PNG','image/png',2599,'2010-09-21 10:53:29',8,NULL,''),(16,'Lehrstellenmarkt.de','lehrstellenmarkt.de ist ein Portal fr Lehrstellen und Praktika sowie Studentenpltze. Die Brse pflegt Kooperationen, wodurch die Reichweite erhht wird. Derzeit (07/2011) sind ber 400 Angebote aus allen Branchen und Bereichen eingestellt, die Azubis suchen oder Praktika anbieten. In diesem Bereich knnen Unternehmen effizient Bewerber ansprechen und ihre offenen Stellen anbieten.\r\n\r\n\r\n','http://www.lehrstellenmarkt.de',5,3,1,1,1,'2010-09-21 10:56:38','2012-01-25 11:11:06','lehrstellenmarkt.png','image/png',26814,'2010-09-21 10:56:37',7,NULL,''),(17,'Gastronomie.de','Stellenbrse fr Gastronomie, Hotellerie und Getrnkewirtschaft.','http://www.gastronomie.de',5,1,0,1,1,'2010-09-21 10:58:23','2012-01-24 15:14:44','gastronomie.de.PNG','image/png',4535,'2010-10-06 15:15:14',8,33,''),(18,'Landjobs.de','Agrarjobportal fr Firmen, Landwirte, Auszubildende und Studenten mit Diplomarbeitenbrse, Bewerbungstipps und Firmenverzeichnis','http://www.landjobs.de',3,1,0,1,1,'2010-09-21 10:59:01','2012-01-25 11:08:47','Landjobs.jpg','image/jpeg',26849,'2010-09-21 10:59:01',5,NULL,''),(19,'Easy4more.de','Jobbrse fr Nordrhein-Westfalen','http://www.easy4more.de',3,1,0,1,1,'2010-09-21 11:05:00','2012-01-24 13:52:40','easy4more.png','image/png',3815,'2010-10-06 14:58:17',5,NULL,''),(22,'EFinancialcareers.de','eFinancialcarreers ist eine fhrende Jobbrse im Karrierenetzwerk fr Investment Banking und den Finanzmarkt. Das Portal ist in 5 Lndern sowie an 22 Mrkten weltweit vertreten und bietet international bis zu 10.000 offene Stellen an; in Deutschland, sterreich und der Schweiz zusammen derzeit 580 (07/2011). Die Lebenslaufdatenbank optimiert die Suche nach qualifizierten Bewerbern, Personaler haben auerdem die Mglichkeit, den Bewerberkreis spezifizierend einzuengen. Unternehmen, die auf der Suche nach qualifizierten Spezialisten sind, knnen hier Bewerber auf ihre freien Stellen aufmerksam machen.','http://www.efinancialcareers.de',7,3,0,1,1,'2010-09-21 11:09:10','2012-01-24 13:57:04','efinancialcareers.jpg','image/jpeg',6324,'2010-09-21 11:09:10',7,NULL,''),(24,'Elternjobs.de','Stellenanzeigen von familienfreundlichen Unternehmen - Elternjobs ist eine junge Informations- und Stellenbrse fr Eltern und familienfreundliche Unternehmen rund um das Thema Vereinbarkeit von Beruf und Familie.','http://www.elternjobs.de',3,2,0,1,1,'2010-09-21 11:31:26','2012-01-24 14:02:24','elternjobs_logo.jpg','image/jpeg',10848,'2010-09-21 11:31:26',5,NULL,''),(25,'Energate.de','Stellenbrse fr die Energiewirtschaft - Portal mit aktuellen Nachrichten, Daten und Informationen zum Energiemarkt','http://www.energate.de',4,2,0,1,1,'2010-09-21 11:34:33','2012-01-24 14:03:00','energate.png','image/png',3584,'2010-09-21 11:34:32',4,NULL,''),(26,'Gelegenheitsjobs.de','Diese Jobbrse ist speziell ausgerichtet fr Nebenjobs, Praktika und Aushilfsjobs. Zum zielgerichteten Inserieren stehen dabei folgende Kategorien zur verfgung: Jobs fr Studenten, Jobs am Wochenende, Jobs ab 45, Minijobs, Jobs fr Ferien, Jobs von zu Hause, Qualifizierte Jobs, Vollzeit/Teilzeit.   ','http://www.gelegenheitsjobs.de',7,2,1,1,1,'2010-09-21 11:35:59','2012-01-24 15:27:57','gelegenheitsjobs.PNG','image/png',2358,'2010-09-21 11:35:59',6,NULL,''),(27,'Energie.de','energie.de ist das Netzwerk fr Fach- und Fhrungskrfte der Energiewirtschaft mit Diskussionsforum, tagesaktuellen Brancheninformationen und Informationen zu Seminaren, Kongressen und Messen. Im Rahmen der Business-Community finden Unternehmen neue Business-Kontakte und Ansprechpartner. Unternehmen prsentieren sich selbst in einem branchenspezifischen Umfeld und werden selbst von anderen Mitgliedern des Netzwerks gefunden.','http://www.energie.de',4,2,0,1,1,'2010-09-21 11:37:03','2012-01-24 14:03:22','logo_300dpi_Kopie.jpg','image/jpeg',38453,'2010-10-07 16:07:09',7,NULL,''),(28,'Geoagentur.de','Dies ist die Stellenbrse der GEOAgentur Berlin Brandenburg. Ein Hauptanliegen der Seite ist es, ber die Arbeitsmglichkeiten innerhalb des Berufsstand Geowissenschaft und Geotechnik zu informieren. Schwerpunktmssig geht es dabei um die Zusammenfhrung geowissenschaftlicher Absolventen und Unternehmen. ','http://www.geoagentur.de',3,3,0,1,1,'2010-09-21 11:38:57','2012-01-24 15:28:38','geoAgentur.PNG','image/png',17368,'2010-10-06 13:58:35',7,NULL,''),(29,'Geojobs.de','Geojobs ist die Stellenbrse fr alle Geobranchen, d. h. Geoinformatik, Geographie, Kartographie, Geologie & Geophysik, kologie & Umwelt, Hydrologie & Meteorologie, Vermessung, Fernerkundung & Photogrammetrie sowie Navigation & Telematik. Die Stellenangebote und Stellengesuche sind nach den Arbeitsschwerpunkten und nach Beginn der Ttigkeit sortiert, so dass Unternehmen zielgerichtet die passende Arbeitskraft suchen knnen.\r\n','http://www.geojobs.de',3,1,0,1,1,'2010-09-21 11:41:06','2012-01-24 15:29:04','GEOJobs.PNG','image/png',7131,'2010-10-06 13:59:17',6,NULL,''),(30,'Energiejobs.de','Stellenbrse fr die Energiebranche - energiejobs.de ist Deutschlands ltestes Karriereportal der Energiewirtschaft im Internet (seit 2000). Die langjhrige Erfahrung und hohe Zahl an Energie-Partnerfirmen hilft Fach- und Fhrungskrften gezielt bei der Stellensuche auf dem Energiemarkt. Die Vernetzung mit fhrenden Energieportalen und Energie-Newslettern mit bis zu 40.000 Abonnenten sorgt fr eine hohe Reichweite direkt in der Zielgruppe.','http://energiejobs.de',3,1,0,1,1,'2010-09-21 11:41:51','2012-01-24 14:04:22','energie-jobs.jpg','image/jpeg',4463,'2010-09-21 11:41:51',4,NULL,''),(31,'Gdch.de - Gesellschaft Deutscher Chemiker','Die Gesellschaft Deutscher Chemiker ist die grte chemiewissenschaftliche Fachgesellschaft Kontinentaleuropas mit Mitgliedern aus Hochschulen, Industrie, Behrden und freier Ttigkeit. Die spezialisierte Jobbrse dieser Plattform stellt fr Unternehmen die ideale Mglichkeit dar, zielgerichtet nach qualifizierten Arbeitskrften wie etwa Chemiker, Biochemiker, Lebensmittelchemiker und Chemie-Ingenieure zu suchen.','http://www.gdch.de',5,4,0,1,1,'2010-09-21 11:42:46','2012-01-24 15:34:50','GDCh_Logo_25mm_4c_V02.jpg','image/jpeg',198518,'2010-10-08 15:09:59',12,NULL,''),(33,'Gigajob.com','Diese allgemeine Jobbrse zeichnet sich durch die hohe Anzahl an Mitgliedern sowie ber 90.000 Bewerberprofilen. Unternehmen und Institutionen knnen mit Ihrer Stellenanzeige hier ein breites Publikum ansprechen.','http://de.gigajob.com',8,4,0,1,1,'2010-09-21 11:47:38','2012-01-24 15:38:08','Gigajob.jpg','image/jpeg',7466,'2010-10-07 16:44:00',9,NULL,''),(34,'Glassglobal.com','Stellenbrse speziell fr die Glasindustrie','http://www.glassglobal.com',4,2,0,1,1,'2010-09-21 11:49:55','2012-01-24 15:39:03','glass_global.jpg','image/jpeg',6194,'2010-09-21 11:49:55',6,NULL,''),(35,'Go-Jobware.de','Studenten und Absolventen knnen sich hier ber alles rund ums Thema Berufseinstieg und Bewerbung informieren. Entsprechend ntzlich ist die dazugehrige Stellenbrse fr Sie als Unternehmen, auf der Suche nach einem passenden Mitarbeiter.','http://www.go-jobware.de',6,4,1,1,1,'2010-09-21 11:54:54','2012-01-27 15:11:00','GO_Jobware.PNG','image/png',13622,'2010-10-06 14:01:48',10,NULL,''),(36,'Mediajobs.de','mediajobs.de ist eine Jobbrse, die sich auf den Bereich \'Medienschaffende und Stellen in der Medienbranche\' spezialisiert hat. Tgliche Job-Mails informieren registrierte Nutzer ber neue Stellenangebote. Viele TV- und Rundfunkanstalten inserieren auf der Seite. Unternehmen knnen hier qualifizierte Spezialisten der Branche effektiv auf freie Stellen aufmerksam machen.','http://www.mediajobs.de',6,2,0,1,1,'2010-09-21 11:57:32','2012-01-25 11:18:25','mediajobs.PNG','image/png',6668,'2010-09-21 11:57:32',8,NULL,''),(38,'Greenjobs.de','greenjobs.de verffentlicht Stellenanzeigen, die einen Bezug zum Thema Umwelt oder umweltnahen Unternehmen oder Organisationen in Deutschland haben. Die Seite wird 300.000 mal pro Monat aufgerufen und kann 1 Mio Seitenaufrufe verzeichnen. 800 laufend aktuelle Stellenangebote werden verzeichnet. Greenjobs.de betreibt zustzlich eejobs.de und die Fachzeitschrift \"Solarthemen\". Fr Unternehmen aus der \"Grnen Branche\", die auf der Suche nach sachkundigen Experten sind bietet sich diese Plattform zur Rekrutierung an.','http://www.greenjobs.de',7,3,0,1,1,'2010-09-21 12:00:03','2012-01-24 15:46:36','Greenjobs.de.PNG','image/png',12524,'2010-11-29 10:09:04',8,NULL,''),(39,'Gruenejobs.de','gruenejobs.de bietet fast ausschlielich Jobs aus dem Bereich Gartenbau. Die Jobbrse wird zustzlich auf 8 angeschlossenen Online-Fachzeitschriften verlinkt, die auch zum thematischen Kreis Gartenbau gehren. Somit ist eine erhhte Reichweite sichergestellt. Unternehmen, die sachkundiges Personal aus der Branche suchen, bietet sich diese Plattform zur Rekrutierung an.','http://gruenejobs.de',4,2,0,1,1,'2010-09-21 12:05:17','2012-01-24 15:47:13','GrueneJobs.PNG','image/png',4950,'2010-10-06 13:52:43',8,NULL,''),(40,'Gruener-Stellenmarkt.de','Stellenbrse im Bereich Gartenlandschaftsbau, Zierpflanzenbau, Baumschulwesen, grner Einzelhandel und Landwirtschaft.','http://www.gruener-stellenmarkt.de',3,3,0,1,1,'2010-09-21 12:07:07','2012-01-24 15:47:49','Gr_nerStellenmarkt.PNG','image/png',11239,'2010-09-21 12:07:07',6,NULL,''),(41,'Entwickler.com','entwickler.com ist auf Stellen in der 