5,NULL,''),(46,'Gwa.de - Gesamtverband Kommunikationsagenturen','Die GWA Jobbrse ist auf Jobs in Kommunikations-agenturen spezialisiert. Die Mitgliedsagenturen des GWA gehren zu den Besten der Branche. Im GWA Suchagent finden Sie Agenturprofile, Informationen zu Kunden und Awards und reichlich Beispiele fr gute Kommunikation. ','http://www.gwa.de',7,4,0,1,1,'2010-09-21 12:17:31','2012-01-24 15:33:37','gwa.PNG','image/png',6009,'2010-10-06 14:00:14',10,NULL,''),(49,'ERP-Stellenmarkt.de','Stellenangebote rund um ERP (Enterprise Resource Planning) Systeme.','http://www.erp-stellenmarkt.de',4,3,0,1,1,'2010-09-21 12:24:01','2012-01-24 14:10:48','ERP-Stellenmarkt_de-Logo.JPG','image/jpeg',9884,'2010-10-07 16:28:12',7,NULL,''),(50,'Hamburger Abendblatt','Stellenmarkt fr den Norddeutschen Raum, insbesondere Hamburg - Das Portal bietet viele Tipps, News und Lokaltiefe. Als Norddeutschlands meistgenutzter Service- und Informationsplattform gehrt abendblatt.de zu den Top 10 der deutschen Nachrichtenportale.','http://www.abendblatt.de',9,3,0,1,1,'2010-09-21 12:26:56','2010-10-06 11:03:46','Hamburger_Abendblatt.PNG','image/png',5289,'2010-09-21 12:26:55',5,NULL,''),(52,'Handelsvertreter.de','handelsvertreter.de bietet Jobs fr Handelsvertreter aus allen Bereichen. Es werden ber 150 Stellenangebote aus der Branche inseriert. Die Seite spricht die Zielgruppe der Handelsvertreter in Deutschland an und informiert per Email-Push-Service ber neue Stellen. handelsvertreter.de gehrt dabei zu der Plattform come-into-contact.com, die von IUCAB und der CDH getragen wird. Unternehmen, die sachkundiges Personal aus der Branche suchen, bietet sich diese Plattform zur Findung passender Bewerber an.\r\n','http://www.handelsvertreter.de',6,2,0,1,1,'2010-09-21 12:28:27','2012-01-24 15:55:46','handelsvertreter.de.PNG','image/png',12267,'2012-01-24 15:55:46',7,NULL,''),(53,'Handwerkerstellen.de','handwerkerstellen.de ist eine der einschlgigsten Seiten fr die Jobvermittlung in der Handwerkerbranche. 