r ist Ihre Stellenanzeige fr die kreative Branche richtig platziert.','http://www.dasauge.de',3,4,0,1,1,'2010-09-24 01:46:50','2012-01-24 11:56:02','dasauge_neu.JPG','image/jpeg',17466,'2011-10-26 07:41:52',8,NULL,''),(436,'Deutsche Bauzeitung','Die deutsche bauzeitung zhlt zu den ersten Adressen unter den Architektur-Fachzeitschriften und bietet wichtige Informationen rund um die Themen Architektur und Technik. Unternehmen knnen auf dem dazughrigen Stellenmarkt ambitionierte Architekten, Bauingenieure und weitere Spezialisten aus der Branche ansprechen.','http://db.bauzeitung.de',4,4,0,1,1,'2010-09-24 01:46:50','2011-08-02 08:53:10','Deutsche_Bauzeitung.jpg','image/jpeg',51340,'2010-09-24 13:20:29',5,NULL,''),(437,'Deister-Leine-Zeitung','Jobbrse der Deister-Leine-Zeitung','http://www.deister-leine-zeitung.de',4,3,0,1,1,'2010-09-24 01:46:50','2010-09-28 13:14:42','deister-leine-zeitung.jpg','image/jpeg',7367,'2010-09-24 13:20:01',3,NULL,NULL),(438,'Dentonline.de','dentonline.de ist ein erfogreich etablierter, interaktiver Kleinanzeigenmarkt im Internet fr den zahnmedizinischen Bereich.','http://www.dentonline.de',3,2,0,1,1,'2010-09-24 01:46:50','2012-01-24 11:58:19','dentonline.png','image/png',7731,'2010-10-06 12:59:28',6,NULL,''),(439,'Design-Report.de','Der desgin report ist das fhrende deutschsprachige B2B-Magazin fr Gestaltung. Der design report richtet sich an die Entscheider, die fr die Designstrategie im Unternehmen verantwortlich sind und an Designer und Designbros, die fr namhafte Auftraggeber arbeiten.','http://www.design-report.de',4,4,0,1,1,'2010-09-24 01:46:50','2012-01-24 13:16:56','design-report.jpg','image/jpeg',30313,'2010-09-24 13:19:21',4,NULL,''),(440,'Deutsche Sporthochschule Kln','Die Deutsche Sporthochschule Kln ist in ihrer Forschung, Lehre, Weiterbildungs- und Beratungsaktivitten auf den Sport als gemeinsamen, bergreifenden Bezugspunkt ausgerichtet.','http://www.dshs-koeln.de',7,4,0,1,1,'2010-09-24 01:46:50','2010-10-20 15:17:44','deutsche