:25',3,NULL,''),(1064,'Aubi-Plus.de','AUBI-plus rekrutiert fr Unternehmen und Hochschulen geeignete Auszubildende, Studierende und Absolventen. ber das Karriereportal www.aubi-plus.de  bringt AUBI-plus die Angebote der Unternehmen bzw. Hochschulen mit den Gesuchen der jungen Talente zusammen. Dabei werden Kundenanforderungen erfllt, die vom Bewerbermarketing ber Employer-Branding-Manahmen bis hin zum E-Recruiting-System reichen.','http://www.aubi-plus.de',7,3,0,1,1,'2010-10-15 08:02:06','2012-01-24 08:32:58','aubi-plus.jpg','image/jpeg',35595,'2010-10-15 08:02:06',4,NULL,''),(1065,'Newjob.de','newjob.de ist eine auf SAP spezialisierte Jobbrse. Die Brse geniet einen hohen Bekanntheitswert und wird auf dem 1. Platz bei Google unter \'SAP Job\' gelistet. Die Reichweite und das Angebot an SAP-related Jobs sind sehr hoch. Unternehmen knnen ber newjob.de gezielt qualifizierte Spezialisten aus dem SAP-Bereich auf sich aufmerksam machen.','http://www.newjob.de',6,3,0,1,1,'2010-10-15 08:34:27','2012-01-25 09:19:53','newjob.jpg','image/jpeg',774,'2010-10-15 08:34:27',2,NULL,''),(1067,'Absolvent.de','Die spezielle Jobbrse fr Absolventen und Studenten fr alle Branchen und Berufsfelder. Zustzlich bietet die Website eine community zum Kontakte knpfen und Erfahrungsaustausch.','http://www.absolvent.de',5,2,0,1,1,'2010-10-15 10:05:50','2012-01-23 15:45:52','absolvent.jpg','image/jpeg',2910,'2010-10-15 10:06:58',2,NULL,''),(1068,'Der Tagesspiegel','Der Tagesspiegel ist als eine der serisesten Tageszeitungen sowohl auf dem Berliner als auch auf dem berregionalen Zeitungsmarkt etabliert. Der dazugehrige Stellenmarkt ermglicht es Unternehmen oder Institutionen sowohl Online- als auch Printanzeigen zu schalten. Durch die hohe Reichweite der Zeitung und auch der Online-Ausgabe bietet sich diese Stellenbrse an, um effizient nach dem richtigen Mitarbeiter in allen Branchen zu suchen.','http://www.tagesspiegel.de',9,3,0,1,1,'2010-10-18 09:17:42','2012-01-24 11:53:11','Logoss.jpg','image/jpe