hsprachiges B2B-Portal fr News und Informationen rund um die globale Videospielindustrie. Neben dem redaktionellen Bereich wird eine internationale Jobbrse geboten, die durch Auswahlkriterien weltweit Jobs der Branche vermittelt. Programmieren, Game Design und Art/Animation sind die Schwerpunkte. Pro Monat werden fr Deutschland-sterreich-Schweiz jeweils durchschnittlich 30-50 Inserate eingetragen. Die Seite bietet eine hohe Reichweite in der Gamesbranche.','http://www.gamesindustry.biz/',8,2,0,1,1,'2011-04-20 09:32:22','2012-01-24 15:09:42','gamesindustry.biz.jpg','image/jpeg',38979,'2011-04-20 09:32:39',3,NULL,''),(1133,'sentiso.de','Bei sentiso trifft Erfahrungsangebot auf Erfahrungsnachfrage. Wir bringen arbeitsfreudige Ruhestndler mit Unternehmen zusammen, um auf Projektbasis zusammen zu arbeiten. Unternehmen stellen hierzu Projekte ein und die Ruhestndler knnen sich dann auf die Projekte bewerben, die sie interessieren  kostenfrei, unbrokratisch und einfach. Die Erfahrungen und Kenntnisse die von den Unternehmen gesucht werden reicht dabei ber alle Branchen und Ausbildungsformen.','http://www.sentiso.de',3,2,0,1,1,'2011-05-09 06:43:29','2011-05-09 06:43:29','sentiso-logo.jpg','image/jpeg',39387,'2011-05-09 06:43:28',0,NULL,''),(1134,'Sinojobs.de','SinoJobs ist das fhrende Jobportal fr deutsch-chinesische Stellenanzeigen. Es bietet Lesern aktuelle Stellenangebote aus Deutschland und der Greater China Region. Auerdem informiert ein wchentlicher Jobletter ber die neuesten Stellenanzeigen der Woche. Stellenanzeigen knnen selbst aufgegeben werden und sind kostenlos.','http://sinojobs.de/',5,3,0,1,1,'2011-05-24 15:48:59','2012-01-24 14:45:52','SinoJobs-Logo-DE.jpg','image/jpeg',14613,'2011-05-24 15:48:59',3,NULL,''),(1139,'Agrarzeitung','Agrarzeitung.de bietet einen spezialisierten Stellenmarkt fr Berufe aus dem Bereich Agrar- und Ernhrungswirtschaft. Vom Vertriebsmitarbeiter ber den Produktionsmitarbeiter bis zum Agraringenieur knnen Unternehmen hier branchenspezifi