nalisten und Redakteure sowie aus der ffentlichkeitsarbeit und PR-Branche aus jeweils allen relevanten Bereichen Inserate bereitstellt. Recruiter knnen hier effizient professionelles und spezialisiertes Personal aus der Branche auf freie Stellen aufmerksam machen.','http://www.journalist.de',6,3,0,1,1,'2011-08-04 13:30:48','2012-01-25 10:21:22','journalist.de.JPG','image/jpeg',14596,'2011-08-04 13:30:47',1,NULL,''),(1157,'Legalcareers.de','LegalCareers.de ist ein juristisches Karriereportal, welches ber aktuelle Entwicklungen auf dem juristischen Arbeits- und Wirtschaftsmarkt informiert. Die umfassenden Jobbrse, welche nach Rechtsgebieten, Position, Vertragsart und Berufserfahrung unterteilt ist, ermglicht Unternehmen entsprechend qualifizierte Fachkrfte zielgerichtet anzusprechen und auf offene Stellen aufmerksam zu machen.','http://legalcareers.de',3,3,0,1,1,'2011-08-04 14:03:37','2012-01-25 11:10:25','legalcareers.jpg','image/jpeg',23896,'2011-08-04 14:03:36',1,NULL,''),(1158,'Logistikplatz.de','Logistikplatz.de ist eine Stellenbrse mit klarem Fokus auf die Berufsbereiche Logistik, Warenfluss, Spedition, Lagerungs- und Transportgewerbe. Mit ca. 65.000 Usern im Monat und durch den sehr hohen Bekanntheitsgrad in der Branche ermglicht dieses Berufsportal Unternehmen die zielgerichtete Suche nach qualifizierten Mitarbeitern.','http://www.logistikplatz.de',3,3,0,1,1,'2011-08-04 14:14:36','2011-08-04 14:14:36','logistikplatz.de.jpg','image/jpeg',4879,'2011-08-04 14:14:36',0,NULL,''),(1159,'Materialsviews.com','materialsviews.com ist ein englischsprachiges Portal mit naturwissenschaftlichem und materialwissenschaftlichem Hintergrund mit angeschlossener internationaler Jobbrse. Neben Materialwissenschaftlern besuchen Physiker, Chemiker und Polymerwissenschaftler sowie Ingenieure die Seite. Etwa 16.000 Besucher im Monat kommen auf die Seite. Mehrere Hundert Inserate pro Monat sind eingetragen. Die Seite hat eine hohe Reichweite in der Branche, wodurch Unternehmen gezielt 