n zu besetzen, optimal auf sich aufmerksam machen.','http://www.wuv.de/',9,4,0,1,1,'2011-08-05 09:59:18','2011-08-05 09:59:18','w&v_logo_gro.jpg','image/jpeg',44337,'2011-08-05 09:59:17',0,NULL,''),(1173,'Vioworld.de','vioworld.de bietet eine Jobbrse fr die Bereiche (klassische) Musik und Kultur. Stellenangebote sind mglich in den Bereichen Gesang/Chre, Orchester, Kulturmanagement, Ballett/Tanz, Theater und musisch/knstlerisch orientierten Ttigkeiten an Hochschulen. Die Angebote bestechen nicht durch ihre Vielzahl, sondern eher durch ihre spezialisierte Passgenauigkeit. Inserenten werden hier gezielt fndig, falls sie fr Musiker, Bhnenschauspieler und Tnzer sowie Kulturschaffende inserieren.','http://www.vioworld.de',5,2,0,1,1,'2011-08-05 10:02:23','2012-01-24 09:49:46','Vioworld.de_logo.jpg','image/jpeg',9612,'2011-08-05 10:02:23',1,NULL,''),(1174,'Vertikult.de','vertikult.de ist eine Jobbrse im Kulturbereich. 5-15 Stellen pro Monat werden verffentlicht. Darunter werden Redakteure, Volontre, Intendanten oder Aussteller von Kulturveranstaltungen gesucht. Die Reichweite scheint eher gering. Unternehmen der Kulturbranche knnen hier Stellenangebote platzieren und Bewerber auf ihre vakanten Stellen aufmerksam machen.','http://www.vertikult.de/',3,1,0,1,1,'2011-08-05 10:10:26','2012-01-24 10:04:45','vertikult_logo.jpg','image/jpeg',2754,'2011-08-05 10:10:26',1,NULL,''),(1177,'Jobsfrankfurt.net','JobsFrankfurt.net ist der regionale Stellenmarkt fr Frankfurt am Main. Der Frankfurter Stellenmarkt bietet Stellenangebote aus allen Branchen. Arbeitnehmer knnen kostenlose Gesuche inserieren.\r\n','http://www.jobsfrankfurt.net/',5,2,0,1,1,'2011-09-19 16:51:22','2012-01-25 10:09:03','Jobs.Frankfurt.net.jpg','image/jpeg',13048,'2011-09-19 16:51:22',2,NULL,''),(1180,'Pflege.de','Pflege.de hilft bei der Suche nach einem Job in der Pflege oder einem Jobwechsel. Das Jobportal von pflege.de bietet Pflegekrften die Mglichkeit, ihren Lebenslauf kostenlos und auf Wunsch anonym in die Bewer